import React from "react";
import { Container, Row, Col} from 'react-bootstrap';
import "../App.css";

function Contact() {
  return (
      <Container>
      <Row>
      <Col xs={12} md={8}>
    <div className="row">
    <div className="card contact-card">
      <div className="card-header contact-card-head ">Contact Information</div>
      <div className="card-body">
        <h4>Name: Mengyue Zhang</h4>
        <h4>Phone Number: 240-413-0493</h4>
        <h4>Email: mengyue.z@outlook.com</h4>
        <a class="mr-2" href="https://www.linkedin.com/in/mengyue-zhang/" target="blank"><img src="./images/linkedin.png" alt="linkedin icon" style={{width: "30px"}}/></a>
        <a href="https://github.com/mengyue-z" target="blank"><img src="./images/github.png" alt="github icon" style={{width: "30px"}}/></a>
        </div>
      </div>
  </div>
  </Col>
  </Row>
  </Container>
  );
}

export default Contact;
